$(document).ready(function () {
    // Toastr
    toastr.options = {
        "closeButton": true,
        "debug": false,
        "progressBar": true,
        "preventDuplicates": false,
        "positionClass": "toast-top-right",
        "onclick": null,
        "showDuration": "400",
        "hideDuration": "1000",
        "timeOut": "3000",
        "extendedTimeOut": "1000",
        "showEasing": "swing",
        "hideEasing": "linear",
        "showMethod": "fadeIn",
        "hideMethod": "fadeOut"
    }

    // DataTable
    var tabela = $('#tabelaCasos').DataTable({
        language: {
            "lengthMenu": "Mostrando _MENU_ registros por página",
            "zeroRecords": "Nenhum registro encontrado",
            "info": "Mostrando página _PAGE_ de _PAGES_",
            "infoEmpty": "Não há registros disponíveis",
            "infoFiltered": "(filtrando de _MAX_ registros totais)",
            "search": "Buscar",
            "loadingRecords": "Carregando...",
            "processing": "Processando...",
            "paginate": {
                "first": "Primeira",
                "last": "Ultima",
                "next": "Próxima",
                "previous": "Anterior"
            }
        },
        pageLength: 10,
        responsive: true,
        dom: '<"html5buttons"B>lTfgitp',
        buttons: [
            {
                extend: 'copy',
                text: 'Copiar'
            },
            {
                extend: 'csv'
            },
            {
                extend: 'excel',
                title: 'AcompanhamentoCasosArgus',
                extension: '.xlsx'
            },
            {
                extend: 'pdf',
                title: 'Acompanhamento de Casos - Argus Safety',
                orientation: 'landscape',
                pageSize: 'A4',
                customize: function (doc) {
                    var m = moment().format("DD/MM/YYYY hh:mm:ss a");
                    
                    //var objFooter = {};

                    var objHeader = function (currentPage, pageCount, pageSize) {
                        return [
                          { text: 'Página ' + currentPage + ' de ' + pageCount + '     |     Emitido em: ' + m, alignment: 'center', margin: 5 },
                          {
                              columns: [
                                        {
                                            image: 'data:image/png;base64,',
                                            width: 35,
                                            height: 35,
                                            margin: [40]
                                        },
                              ]
                          }
                        ]
                    };

                    //function (currentPage, pageCount) { return 'Página ' + currentPage.toString() + ' de ' + pageCount; };
                    //var cols = [];
                    //cols[0] = { text: 'Emitido em: ' + m, alignment: 'left', margin: [40] };
                    //objFooter['alignment'] = 'center';
                    //objFooter['columns'] = cols;
                    //doc["footer"] = objFooter;

                    doc["header"] = objHeader;

                    //doc.content.splice(1, 0, {
                    //    alignment: 'left',
                    //    image: 'data:image/png;base64,',
                    //    fit: [30, 30]
                    //});
                }
            },
            {
                extend: 'print',
                text: 'Imprimir',
                customize: function (win) {
                    $(win.document.body).addClass('white-bg');
                    $(win.document.body).css('font-size', '10px');

                    $(win.document.body).find('table')
                            .addClass('compact')
                            .css('font-size', 'inherit');
                }
            }
        ]

    });

    // Chamada AJAX
    $.ajax({
        async: false,
        url: 'Home/SumarioGrafico',
        dataType: "json",
        type: "GET",
        contentType: 'application/json; charset=utf-8',
        async: false,
        processData: false,
        cache: false,
        delay: 15,
        success: function (data) {
            var series = new Array();
            for (var i in data) {
                var serie = new Array(data[i].Status, parseFloat(data[i].Quantidade));
                series.push(serie);
            }
            drawPieChart(series);
        },
        error: function (xhr) {
            alert('Erro ao gerar gráfico');
        }
    });

    // Função para Highcharts
    function drawPieChart(series) {
        Highcharts.chart('graph', {
            chart: {
                plotBackgroundColor: null,
                plotBorderWidth: null,
                plotShadow: false,
                type: 'pie',
            },
            title: {
                text: 'Acompanhamento de Status - Argus - APSEN'
            },
            tooltip: {
                pointFormat: '{series.Status}: <b>{point.y}</b>'
            },
            plotOptions: {
                pie: {
                    allowPointSelect: true,
                    cursor: 'poniter',
                    point: {
                        events: {
                            click: function () {
                                Command: toastr["success"]("O Filtro " + this.name + " foi aplicado na tabela abaixo.", "Filtro Realizado")
                                tabela.search(this.name).draw();
                            }
                        }
                    },
                    dataLabels: {
                        enabled: false
                    },
                    showInLegend: true
                }
            },
            credits: false,
            series: [{
                name: '',
                colorByPoint: true,
                data: series
            }]
        });
    }
});